Tool"},{"attributes":{},"id":"1321","type":"Selection"},{"attributes":{"child":{"id":"1401"},"title":"Summary"},"id":"1402","type":"Panel"},{"attributes":{},"id":"1456","type":"AllLabels"},{"attributes":{"axis":{"id":"1163"},"coordinates":null,"group":null,"ticker":null},"id":"1165","type":"Grid"},{"attributes":{},"id":"1508","type":"UnionRenderers"},{"attributes":{},"id":"1476","type":"BasicTickFormatter"},{"attributes":{},"id":"1457","type":"UnionRenderers"},{"attributes":{"start":0},"id":"1286","type":"DataRange1d"},{"attributes":{"axis":{"id":"1263"},"coordinates":null,"dimension":1,"group":null,"ticker":null},"id":"1266","type":"Grid"},{"attributes":{},"id":"1498","type":"Selection"},{"attributes":{},"id":"1493","type":"AllLabels"},{"attributes":{},"id":"1497","type":"UnionRenderers"},{"attributes":{"style":{"border":"1px solid lightgray","box-shadow":"inset 1px 0 8px 0 lightgray","height":"100%","max-height":"1080px","max-width":"1920px","overflow":"auto","padding":"12px","width":"100%"},"text":"\n        &lt;h1&gt; Dask Performance Report &lt;/h1&gt;\n        &lt;i&gt; Select different tabs on the top for additional information &lt;/i&gt;\n        &lt;h2&gt; Duration: 101.26 s &lt;/h2&gt;\n        &lt;h2&gt; Tasks Information &lt;/h2&gt;\n        &lt;ul&gt;\n         &lt;li&gt; number of tasks: 1012 &lt;/li&gt;\n         \n&lt;li&gt; compute time: 146.44 s &lt;/li&gt;\n&lt;li&gt; deserialize time: 10.89 s &lt;/li&gt;\n&lt;li&gt; transfer time: 576.18 ms &lt;/li&gt;\n        &lt;/ul&gt;\n        &lt;h2&gt; Scheduler Information &lt;/h2&gt;\n        &lt;ul&gt;\n          &lt;li&gt; Address: tcp://10.7.0.1:8786 &lt;/li&gt;\n          &lt;li&gt; Workers: 240 &lt;/li&gt;\n          &lt;li&gt; Threads: 9600 &lt;/li&gt;\n          &lt;li&gt; Memory: 37.50 TiB &lt;/li&gt;\n          &lt;li&gt; Dask Version: 2021.11.2 &lt;/li&gt;\n          &lt;li&gt; Dask.Distributed Version: 0+untagged.1.g608b984.dirty &lt;/li&gt;\n        &lt;/ul&gt;\n        &lt;h2&gt; Calling Code &lt;/h2&gt;\n        &lt;pre&gt;\n###################################################################################################\n# Copyright (c) 2020-2022 Centre national de la recherche scientifique (CNRS)\n# Copyright (c) 2020-2022 Commissariat a l'\u00e9nergie atomique et aux \u00e9nergies alternatives (CEA)\n# Copyright (c) 2020-2022 Institut national de recherche en informatique et en automatique (Inria)\n# Copyright (c) 2020-2022 Universit\u00e9 Paris-Saclay\n# Copyright (c) 2020-2022 Universit\u00e9 de Versailles Saint-Quentin-en-Yvelines\n#\n# SPDX-License-Identifier: MIT\n#\n###################################################################################################\n\n# from deisa import Deisa\nfrom dask_interface import Deisa\nfrom dask.distributed import performance_report, wait\nimport os\nimport time\n\nos.environ[\"DASK_DISTRIBUTED__COMM__UCX__INFINIBAND\"] = \"True\"\n\n# Scheduler file name and configuration file\nscheduler_info = 'scheduler.json'\nconfig_file = 'config.yml'\n\n# Initialize Deisa\nDeisa = Deisa(scheduler_info, config_file)\n\n# Get client\nclient = Deisa.get_client()\n\n# either: Get data descriptor as a list of Deisa arrays object\narrays = Deisa.get_deisa_arrays()\n# or: Get data descriptor as a dict of Dask array\n# arrays = Deisa.get_dask_arrays()\n\n# Select data\ngt = arrays[\"global_t\"][...]\nprint(gt, flush=True)\n\n# Check contract\narrays.check_contract()\n\n\ndef Derivee(F, dx):\n    \"\"\"\n    First Derivative\n       Input: F        = function to be derivate\n              dx       = step of the variable for derivative\n       Output: dFdx = first derivative of F\n    \"\"\"\n    c0 = 2. / 3.\n    dFdx = c0 / dx * (F[3: - 1] - F[1: - 3] - (F[4:] - F[:- 4]) / 8.)\n    return dFdx\n\nstart = time.time()\n# py-bokeh is needed if you wanna see the perf report\nwith performance_report(filename=\"dask-report.html\"):\n\n    # Construct a lazy task graph\n    cpt = Derivee(gt, 1).mean()\n\n    # Submit the task graph to the scheduler\n    s = client.persist(cpt, release=True)\n\n    # Sign contract\n    arrays.validate_contract()\n    del gt\n    # Print the result, note that \"s\" is a future object, to get the result of the computation,\n    # we call `s.result()` to retreive it.\n    # Write the results\n    with open(\"results.log\", \"a\") as f:\n        f.write(str(client.compute(s).result()))\n\nprint(\"{:&lt;21}\".format(\"EST_TIME:\") + \"{:.5f}\".format(time.time()-start))\n\n\nprint(\"Done\", flush=True)\nclient.shutdown()\n\n        &lt;/pre&gt;\n        "},"id":"1401","type":"Div"},{"attributes":{},"id":"1523","type":"YearsTicker"},{"attributes":{"child":{"id":"bk-bandwidth-type-plot"},"title":"Bandwidth (Types)"},"id":"1408","type":"Panel"},{"attributes":{"source":{"id":"1074"}},"id":"1107","type":"CDSView"},{"attributes":{},"id":"1435","type":"BasicTickFormatter"},{"attributes":{"source":{"id":"1213"}},"id":"1246","type":"CDSView"},{"attributes":{"days":[1,4,7,10,13,16,19,22,25,28]},"id":"1554","type":"DaysTicker"},{"attributes":{"num_minor_ticks":5,"tickers":[{"id":"1460"},{"id":"1461"},{"id":"1462"},{"id":"1463"},{"id":"1464"},{"id":"1465"},{"id":"1466"},{"id":"1467"},{"id":"1468"},{"id":"1469"},{"id":"1470"},{"id":"1471"}]},"id":"1123","type":"DatetimeTicker"},{"attributes":{},"id":"1120","type":"LinearScale"},{"attributes":{"days":[1,8,15,22]},"id":"1465","type":"DaysTicker"},{"attributes":{"callback":null,"point_policy":"follow_mouse","tooltips":"\n            &lt;div&gt;\n                &lt;span style=\"font-size: 14px; font-weight: bold;\"&gt;Name:&lt;/span&gt;&amp;nbsp;\n                &lt;span style=\"font-size: 10px; font-family: Monaco, monospace;\"&gt;@name&lt;/span&gt;\n            &lt;/div&gt;\n            &lt;div&gt;\n                &lt;span style=\"font-size: 14px; font-weight: bold;\"&gt;Filename:&lt;/span&gt;&amp;nbsp;\n                &lt;span style=\"font-size: 10px; font-family: Monaco, monospace;\"&gt;@filename&lt;/span&gt;\n
